  def activate!
    self.active = true
    self.ndelete = false
    save
  end
  
  def approve!
    self.approved = true
    save
  end
  
  def confirm!
    self.confirmed = true
    save
  end
  
  def inactive?
    ndelete && !active 
  end
  
  def deactivate!
    self.ndelete = true
    self.active = false
    save
  end
  
  def self.isDefaultAvatar (url)
    return url == USER_AVATAR_SETTINGS::PROCESSED_DEFAULT_AVATAR_URL
  end
  
  def subscriptionType
    type = 1
    if admin?
      type = subscription_type #get the standard subscription from db
    else 
        type = subscription_type if (!subscription_good_until.nil?) && ((subscription_good_until - Time.now).to_i > 0)
    end
    type
  end
  
  def subscriptionType=(subscription_type_newvalue)
      self.subscription_type = subscription_type_newvalue
      self.subscription_good_until = Time.now + Rails.configuration.app_config[:ADMIN_DEFAULT_SUBSCRIPTION].months
      #Update the time when this subscription is good for 
  end
  
  def subscriptionEndDate
    subscription_good_until.to_s(:custom_datetime) if !subscription_good_until.nil?
  end
  
  def isFacebookUser
    (federated_user_type & FEDERATED_USER::FACEBOOK) == FEDERATED_USER::FACEBOOK
  end
  
  def picture_from_url(url)
    self.avatar = open(url)
  end
  
  def self.prepareDefaultAvatar
    print "Its a new user registration, assign default avatar."
    myAvatar = {:data => USER_AVATAR_SETTINGS::DEFAULT_AVATAR,
                :filename => USER_AVATAR_SETTINGS::DEFAULT_AVATAR_FILENAME,
                :content_type => USER_AVATAR_SETTINGS::DEFAULT_AVATAR_FILETYPE
              }
    
    data = StringIO.new(Base64.decode64(myAvatar[:data]))
    data.class.class_eval { attr_accessor :original_filename, :content_type }
    data.original_filename = myAvatar[:filename]
    data.content_type = myAvatar[:content_type]
    return data
  end
  
  def self.prepareUserAvatar myAvatar
    
    if (myAvatar.is_a?(String)) #Its a URL
      print "No image base64 data in the avatar image, ignore processing image."
      return ""
    end
    
    data = StringIO.new(Base64.decode64(myAvatar[:data]))
    data.class.class_eval { attr_accessor :original_filename, :content_type }
    data.original_filename = myAvatar[:filename]
    data.content_type = myAvatar[:content_type]
    return data
  end
  
  
